    <div className="layout">
      <div className="header"><LayoutHeader/></div>
      <div className="menuNav"><MenuNav/></div>
      <div className="content"><Outlet numrun_cliente={numrun_cliente} /></div>
      <div className="footer"><LayoutFooter/></div>
    </div>
  );
};
